import React from "react";

import "./collection-item.styles.css";

const CollectionItem = ({ item: { imageUrl, price, name, quantity } }) => {
  return (
    <div className="cart-item">
      <img className="collectionitem__image" src={imageUrl} alt="item" />
      <div className="item-datails">
        <span className="name">aaa{name}</span>
        <span className="price">
          {quantity} $sss{price}
        </span>
      </div>
    </div>
  );
};

export default CollectionItem;
